$.fn.serializeObject=function(){var result=Object.create(null);var mapper=function(element){element.name=$.camelCase(element.name);return element};var extend=function(i,element){var node=result[element.name];if("undefined"!==typeof node&&node!==null){result[element.name]=node.push?node.push(element.value):[node,element.value]}else{result[element.name]=element.value}};$.each($.map(this.serializeArray(),mapper),extend);return result};
